import React from 'react';
import './Banner.css';

function Banner() {
    return (
        <div id="about">
             <div className="cotainer">
                  <div className="col-left">
                      <div className="about-img"> 
                      <img src="./images/cap.png"/></div>

                      </div>
                  <div className="col-right"></div>
             </div>
        </div>
    )
}

export default Banner
